import React from "react";
import styled from "styled-components";
import CounterUp from "react-countup";

const Counter_Up = () => {
  return (
    <>
      <Wrapper>
        <div className="container">
          <div className="grid grid-three-column">
            <div className="content">
              <h1 className="main_heading">Towards Leading the Industry</h1>
              <h1>
                The credits goes to Ftechiz team for making this up to here.
              </h1>
            </div>
            <div className="grid_two_rows">
              <div>
                <h1><CounterUp end={120} duration={5}/>+</h1>
                <p>Project</p>
              </div>
              <div>
                <h1><CounterUp end={40} duration={5}/>+</h1>
                <p>Clients</p>
              </div>
            </div>
            <div className="grid_two_rows">
              <div>
                <h1><CounterUp end={6} duration={5}/>+</h1>
                <p>Year of Experience</p>
              </div>
              <div>
                <h1><CounterUp end={120} duration={5}/>+</h1>
                <p>Clients</p>
              </div>
            </div>
          </div>
        </div>
      </Wrapper>
    </>
  );
};
const Wrapper = styled.section`
  .container {
    padding: 1rem 0;
    background: ${({ theme }) => theme.colors.bg};
    border-radius: 1rem;
    margin: 8rem 12rem;
  }
  .grid {
    display: grid;
    gap: 2rem;
    margin: 3rem 3rem;
  }
  .grid-three-column {
    grid-template-column: repeat(3, 1fr);
    .content {
      .main_heading {
        font-weight: 520;
        color: ${({ theme }) => theme.colors.helper};
        margin-bottom: 2rem;
      }
    }
  }
`;

export default Counter_Up;
